import React from "react";
import { Container, Row } from "reactstrap";
import logo from "../../assets/images/eco-logo.png";

const Header = () => {
  return (
    <header>
      <Container className="bg-black">
        <Row className="bg-gray-400">
          <div>
            <div>
              <img src={logo} alt="" />
            </div>
          </div>
        </Row>
      </Container>
    </header>
  );
};

export default Header;
